import React from "react";
import { Button } from "./Button.js";
import {
  Link
} from "react-router-dom"; 

export function LinkList ({root, lis}) {
  let elements = [];
  lis.forEach((li, i) => {
    elements.push(
      <li key={i}>
        <h3>{li.name}</h3>
        <img src={li.thumb} alt={li.name}/>
        <Link to={`${root}/${li.name}`}>Learn more</Link>
      </li>
    );
  });
  return(
    <ul>
      {elements}
    </ul>
  );
}

